import Foundation
import XCTest
import ArcGIS
@testable import GCI

class WKTUtilsTests: XCTestCase {
    
    override func setUp() {
    }
    
    override func tearDown() {
    }
    
    func testPointWithSpace() {
        
        let wktPoint = "POINT (5.060443 47.319876)".wktPoint
        XCTAssertNotNil(wktPoint)
        XCTAssertEqual(wktPoint?.x, 5.060443)
        XCTAssertEqual(wktPoint?.y, 47.319876)
    }
    
    func testPointWithoutDot() {
        
        let wktPoint = "POINT (5.060443 47)".wktPoint
        XCTAssertNotNil(wktPoint)
        XCTAssertEqual(wktPoint?.x, 5.060443)
        XCTAssertEqual(wktPoint?.y, 47.0)
    }
    
    func testPointWithoutSpace() {
        let wktPoint = "POINT(5.060443 47.319876)".wktPoint
        XCTAssertNotNil(wktPoint)
        XCTAssertEqual(wktPoint?.x, 5.060443)
        XCTAssertEqual(wktPoint?.y, 47.319876)
    }
    
    func testPointToWKT() {
        let spacialReference = AGSSpatialReference(wkid: 4326)
        let point = AGSPoint(x: 5.060443, y: 47.319876, spatialReference: spacialReference)
        XCTAssertEqual("POINT(5.060443 47.319876)", point.wktString)
    }
    
    func testPointMissingYSpace() {
        let wktPoint = "POINT(5.060443)".wktPoint
        XCTAssertNil(wktPoint)
    }
    
    func testNotPoint() {
        let wktPoint = "POINT(Hey)".wktPoint
        XCTAssertNil(wktPoint)
    }
    
    func testRandomText() {
        let wktPoint = "Hey, I'm not a point".wktPoint
        XCTAssertNil(wktPoint)
    }
    
    func testPolygon() {
        let wktPoligon = "POLYGON((7.28515625 26.412632152272554,7.98828125 13.390794426132834,20.46875 13.56173573983633,19.58984375 22.89879570768869,7.28515625 26.412632152272554))".wktPolygon
        XCTAssertNotNil(wktPoligon)
        XCTAssertEqual(5, wktPoligon?.count)
        
        XCTAssertEqual(wktPoligon?[0].x, 7.28515625)
        XCTAssertEqual(wktPoligon?[0].y, 26.412632152272554)
        
        XCTAssertEqual(wktPoligon?[1].x, 7.98828125)
        XCTAssertEqual(wktPoligon?[1].y, 13.390794426132834)
        
        XCTAssertEqual(wktPoligon?[2].x, 20.46875)
        XCTAssertEqual(wktPoligon?[2].y, 13.56173573983633)
        
        XCTAssertEqual(wktPoligon?[3].x, 19.58984375)
        XCTAssertEqual(wktPoligon?[3].y, 22.89879570768869)
        
        XCTAssertEqual(wktPoligon?[4].x, 7.28515625)
        XCTAssertEqual(wktPoligon?[4].y, 26.412632152272554)
    }
    
    func testPolygonWithoutDot() {
        let wktPoligon = "POLYGON((7.28515625 26.412632152272554,7 13.390794426132834,20.46875 13.56173573983633,19.58984375 22.89879570768869,7.28515625 26.412632152272554))".wktPolygon
        XCTAssertNotNil(wktPoligon)
        XCTAssertEqual(5, wktPoligon?.count)
        
        XCTAssertEqual(wktPoligon?[0].x, 7.28515625)
        XCTAssertEqual(wktPoligon?[0].y, 26.412632152272554)
        
        XCTAssertEqual(wktPoligon?[1].x, 7.0)
        XCTAssertEqual(wktPoligon?[1].y, 13.390794426132834)
        
        XCTAssertEqual(wktPoligon?[2].x, 20.46875)
        XCTAssertEqual(wktPoligon?[2].y, 13.56173573983633)
        
        XCTAssertEqual(wktPoligon?[3].x, 19.58984375)
        XCTAssertEqual(wktPoligon?[3].y, 22.89879570768869)
        
        XCTAssertEqual(wktPoligon?[4].x, 7.28515625)
        XCTAssertEqual(wktPoligon?[4].y, 26.412632152272554)
    }
    
